import React from "react";
import style from "./Footer.module.css"

const Footer = () =>{
    return (
        <div className={style.footer}>
         <div className={style.footer-wrapper}>
         <div className={style.footer-menu}>
            <div className={style.menu-item}> Каталог</div>
            <div className={style.menu-item}> Избранное</div>
            <div className={style.menu-item}> Личный кабинет</div>
            <div className={style.menu-item}> Служба поддержки</div>
         </div>
         </div>
        </div>
    );
}

export default Footer;
